import React from "react";
import { Table } from "reactstrap";
import axios from "axios";
import Header from "../component/adminbar";
const master = (props) => {
  return (
    <div>
      <Header />
      {props.data.INFO.NAME}
    </div>
  );
};
master.getInitialProps = async function ({ query }) {
  //const url = require("url");
  //console.log(url);
  //  console.log(query.id);
  const res = await axios.get(
    "https://hanstream.gabia.io/users?NAME=sss&SEX=F&GUBUN_CALENDAR=1&YEAR=1997&MONTH=12&DAY=26&HOUR=10&MINUTE=30&GUBUN_TIME=0",
    {}
  );
  const data = await res.data;

  console.log(data);

  console.log(`Show data fetched. Count: ${data.length}`);
  return {
    data: data,
  };
};
export default master;
